@testset "1.2.1.2 (d+e x)^m (a+b x+c x^2)^p" begin
    (a, b, c, d, e, k, m, n, p, x, ) = @variables a b c d e k m n p x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*x+c*x^2)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*x+c*x^2)^p*when*a=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(b*x+c*x^2)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^3*(b*x + c*x^2)^(1/2), x, 6, -((7*b^3*(b + 2*c*x)*sqrt(b*x + c*x^2))/(128*c^4)) + (7*b^2*(b*x + c*x^2)^(3/2))/(48*c^3) - (7*b*x*(b*x + c*x^2)^(3/2))/(40*c^2) + (x^2*(b*x + c*x^2)^(3/2))/(5*c) + (7*b^5*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(128*c^(9/2))]
    @test_int [x^2*(b*x + c*x^2)^(1/2), x, 5, (5*b^2*(b + 2*c*x)*sqrt(b*x + c*x^2))/(64*c^3) - (5*b*(b*x + c*x^2)^(3/2))/(24*c^2) + (x*(b*x + c*x^2)^(3/2))/(4*c) - (5*b^4*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(64*c^(7/2))]
    @test_int [x^1*(b*x + c*x^2)^(1/2), x, 4, -((b*(b + 2*c*x)*sqrt(b*x + c*x^2))/(8*c^2)) + (b*x + c*x^2)^(3/2)/(3*c) + (b^3*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(8*c^(5/2))]
    @test_int [x^0*(b*x + c*x^2)^(1/2), x, 3, ((b + 2*c*x)*sqrt(b*x + c*x^2))/(4*c) - (b^2*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(4*c^(3/2))]
    @test_int [(b*x + c*x^2)^(1/2)/x^1, x, 3, sqrt(b*x + c*x^2) + (b*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/sqrt(c)]
    @test_int [(b*x + c*x^2)^(1/2)/x^2, x, 3, -((2*sqrt(b*x + c*x^2))/x) + 2*sqrt(c)*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2))]
    @test_int [(b*x + c*x^2)^(1/2)/x^3, x, 1, -((2*(b*x + c*x^2)^(3/2))/(3*b*x^3))]
