    @test_int [(b*x + c*x^2)^(1/2)/x^5, x, 3, -((2*(b*x + c*x^2)^(3/2))/(7*b*x^5)) + (8*c*(b*x + c*x^2)^(3/2))/(35*b^2*x^4) - (16*c^2*(b*x + c*x^2)^(3/2))/(105*b^3*x^3)]
    @test_int [(b*x + c*x^2)^(1/2)/x^6, x, 4, -((2*(b*x + c*x^2)^(3/2))/(9*b*x^6)) + (4*c*(b*x + c*x^2)^(3/2))/(21*b^2*x^5) - (16*c^2*(b*x + c*x^2)^(3/2))/(105*b^3*x^4) + (32*c^3*(b*x + c*x^2)^(3/2))/(315*b^4*x^3)]
