    @test_int [x^2*(b*x + c*x^2)^(3/2), x, 6, -((7*b^4*(b + 2*c*x)*sqrt(b*x + c*x^2))/(512*c^4)) + (7*b^2*(b + 2*c*x)*(b*x + c*x^2)^(3/2))/(192*c^3) - (7*b*(b*x + c*x^2)^(5/2))/(60*c^2) + (x*(b*x + c*x^2)^(5/2))/(6*c) + (7*b^6*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(512*c^(9/2))]
