    @test_int [(b*x + c*x^2)^(3/2)/x^1, x, 4, (b*(b + 2*c*x)*sqrt(b*x + c*x^2))/(8*c) + (1/3)*(b*x + c*x^2)^(3/2) - (b^3*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(8*c^(3/2))]
    @test_int [(b*x + c*x^2)^(3/2)/x^2, x, 4, (3/4)*b*sqrt(b*x + c*x^2) + (b*x + c*x^2)^(3/2)/(2*x) + (3*b^2*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(4*sqrt(c))]
    @test_int [(b*x + c*x^2)^(3/2)/x^3, x, 4, 3*c*sqrt(b*x + c*x^2) - (2*(b*x + c*x^2)^(3/2))/x^2 + 3*b*sqrt(c)*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2))]
    @test_int [(b*x + c*x^2)^(3/2)/x^4, x, 4, -((2*c*sqrt(b*x + c*x^2))/x) - (2*(b*x + c*x^2)^(3/2))/(3*x^3) + 2*c^(3/2)*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2))]
