    @test_int [(b*x + c*x^2)^(3/2)/x^8, x, 4, -((2*(b*x + c*x^2)^(5/2))/(11*b*x^8)) + (4*c*(b*x + c*x^2)^(5/2))/(33*b^2*x^7) - (16*c^2*(b*x + c*x^2)^(5/2))/(231*b^3*x^6) + (32*c^3*(b*x + c*x^2)^(5/2))/(1155*b^4*x^5)]
