    @test_int [x^2*(a*x + b*x^2)^(5/2), x, 7, (45*a^6*(a + 2*b*x)*sqrt(a*x + b*x^2))/(16384*b^5) - (15*a^4*(a + 2*b*x)*(a*x + b*x^2)^(3/2))/(2048*b^4) + (3*a^2*(a + 2*b*x)*(a*x + b*x^2)^(5/2))/(128*b^3) - (9*a*(a*x + b*x^2)^(7/2))/(112*b^2) + (x*(a*x + b*x^2)^(7/2))/(8*b) - (45*a^8*atanh((sqrt(b)*x)/sqrt(a*x + b*x^2)))/(16384*b^(11/2))]
    @test_int [x^1*(a*x + b*x^2)^(5/2), x, 6, -((5*a^5*(a + 2*b*x)*sqrt(a*x + b*x^2))/(1024*b^4)) + (5*a^3*(a + 2*b*x)*(a*x + b*x^2)^(3/2))/(384*b^3) - (a*(a + 2*b*x)*(a*x + b*x^2)^(5/2))/(24*b^2) + (a*x + b*x^2)^(7/2)/(7*b) + (5*a^7*atanh((sqrt(b)*x)/sqrt(a*x + b*x^2)))/(1024*b^(9/2))]
