    @test_int [(a*x + b*x^2)^(5/2)/x^1, x, 5, -((3*a^3*(a + 2*b*x)*sqrt(a*x + b*x^2))/(128*b^2)) + (a*(a + 2*b*x)*(a*x + b*x^2)^(3/2))/(16*b) + (1/5)*(a*x + b*x^2)^(5/2) + (3*a^5*atanh((sqrt(b)*x)/sqrt(a*x + b*x^2)))/(128*b^(5/2))]
