    @test_int [(a*x + b*x^2)^(5/2)/x^10, x, 4, -((2*(a*x + b*x^2)^(7/2))/(13*a*x^10)) + (12*b*(a*x + b*x^2)^(7/2))/(143*a^2*x^9) - (16*b^2*(a*x + b*x^2)^(7/2))/(429*a^3*x^8) + (32*b^3*(a*x + b*x^2)^(7/2))/(3003*a^4*x^7)]
