    @test_int [(a*x + b*x^2)^(5/2)/x^12, x, 6, -((2*(a*x + b*x^2)^(7/2))/(17*a*x^12)) + (4*b*(a*x + b*x^2)^(7/2))/(51*a^2*x^11) - (32*b^2*(a*x + b*x^2)^(7/2))/(663*a^3*x^10) + (64*b^3*(a*x + b*x^2)^(7/2))/(2431*a^4*x^9) - (256*b^4*(a*x + b*x^2)^(7/2))/(21879*a^5*x^8) + (512*b^5*(a*x + b*x^2)^(7/2))/(153153*a^6*x^7)]


